
import {decodeBase64} from "jsr:@std/encoding/base64";
const encodedFiles = {
  "/usr/bin/ls": ""
};

export const files = {
  get:(name) => decodeBase64(encodedFiles[name]),
  getString:(name) => new TextDecoder().decode(decodeBase64(encodedFiles[name])),
}

export function listFiles() {
  return Object.keys(encodedFiles);
}
